import React, { Component } from 'react';
import { connect } from "react-redux";
import { Link } from "react-router-dom";

import { signOut } from "./../../actions/authedUser";
import "./Navbar.css";

class Navbar extends Component {
  render() {
    return (
      <div>
        <span className="nav-item"><Link activeClassName="active-link" to="/homepage">Home</Link></span>
        <span className="nav-item"><Link to="/leaderboard">Leaderboard</Link></span>
        <span className="nav-item">Add Question</span>
        <span className="nav-item">Logged in as: { this.props.username }</span>
        <span className="nav-item">
            <button onClick={() => {
                this.props.hangleClickLogOut(this.props.username);
            }}>Log Out</button>
        </span>
      </div>
    )
  }
}

const mapStateToProps = (state) => {
    return {
        username: state.authedUser.username
    };
}

const mapDispatchToProps = (dispatch) => {
    return {
        hangleClickLogOut: (id) => {
            dispatch(signOut(id));
        }
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Navbar);
